import React from 'react';
import styled from 'styled-components';
import Col from 'react-bootstrap/Col';
import BackgroundImage from './../assets/background.png';


const Styles = styled.div`
    height: 310px;
    width: 320px;
    margin: 0 auto;
    margin-top: 35px;
`;

const CustomImage = styled.div`
    height: 190px;
    width: 320px;
`;

const CustomTitle = styled.div`
    padding: 20px;
    height: 110px;
    background-color: white;
`;


export const CustomCard = (props) => {
    return (
        <Col xl={4} lg={6} md={6} class = 'justify-content-start'>
            <Styles>
                <CustomImage style={{ background: `url(require("./../assets/background.png"))` }}>

                </CustomImage>
                <CustomTitle>
                    <h6 style = {{fontSize: '13px'}}>{props.subTitle}</h6>
                    <p style = {{fontSize: '15px', fontWeight: 'bolder'}}>{props.children}</p>
                </CustomTitle>
            </Styles>
        </Col>
    );
}
